var _source = null;
var _target = null;
var _option;
//关系拓扑图 
//叶子节点点击后连线与取消连线
function LoadChartTree() {
    var Chart = echarts.init(document.getElementById('ChartTree'));
    var DataURL = '[{"StreetName": "南京路街道", "TacticValue":6069,"GroupID":"310101GB02","BuildTopologies":[{"AccountNumber": "0061258072", "TacticValue":2734,"BuildID":"310101A010","BuildName":"创兴金融中心",},{"AccountNumber": "0061258074", "TacticValue":2034,"BuildID":"310101A011","BuildName":"金融中心",}]}, {"StreetName": "南京路街道1", "TacticValue":6069,"GroupID":"310101GB02","BuildTopologies":[{"AccountNumber": "0061258072", "TacticValue":2734,"BuildID":"310101A010","BuildName":"创兴金融中心",},{"AccountNumber": "0061258074", "TacticValue":2034,"BuildID":"310101A011","BuildName":"金融中心",}]},{"StreetName": "南京路街道2", "TacticValue":6069,"GroupID":"310101GB02","BuildTopologies":[{"AccountNumber": "0061258072", "TacticValue":2734,"BuildID":"310101A010","BuildName":"创兴金融中心",},{"AccountNumber": "0061258074", "TacticValue":2034,"BuildID":"310101A011","BuildName":"金融中心",}]},{"StreetName": "南京路街道3", "TacticValue":6069,"GroupID":"310101GB02","BuildTopologies":[{"AccountNumber": "0061258072", "TacticValue":2734,"BuildID":"310101A010","BuildName":"创兴金融中心",},{"AccountNumber": "0061258074", "TacticValue":2034,"BuildID":"310101A011","BuildName":"金融中心",}]},{"StreetName": "南京路街道4", "TacticValue":6069,"GroupID":"310101GB02","BuildTopologies":[{"AccountNumber": "0061258072", "TacticValue":2734,"BuildID":"310101A010","BuildName":"创兴金融中心",},{"AccountNumber": "0061258074", "TacticValue":2034,"BuildID":"310101A011","BuildName":"金融中心",}]}]';
    var result = eval(DataURL);
    var TotalValue = 0;
    var dataid = 1;
    var legend = new Array();
    legend.push("虚拟电厂");
    legend.push("街道");
    legend.push("建筑");


    var Data = new Array();
    var links = new Array();
    var item = new Object();
    item.id = 0;
    item.name = "虚拟电厂";
    item.symbol = 'image://data:image/png;base64,',
    item.symbolSize = 160;
    item.category = "虚拟电厂";
    item.value = TotalValue;
    Data.push(item);

    for (var i = 0; i < result.length; i++) {
        //legend.push(result[i].StreetName);
        TotalValue = TotalValue + result[i].TacticValue;

        var itemS = new Object();
        itemS.id = dataid;
        itemS.name = result[i].StreetName;
        //itemS.symbol = "circle";
        itemS.symbol = 'image://data:image/png;base64,',
        itemS.symbolSize = 70;
        itemS.category = "街道";
        itemS.value = result[i].TacticValue;
        Data.push(itemS);

        var linkItem = new Object();
        linkItem.source = 0;
        linkItem.target = dataid;
        links.push(linkItem);

        for (var j = 0; j < result[i].BuildTopologies.length; j++) {
            var itemB = new Object();
            itemB.id = dataid + 1 + j;
            itemB.name = result[i].BuildTopologies[j].BuildName;
            itemB.symbol = "circle";
            itemB.symbolSize = 30;
            itemB.category = "建筑";
            itemB.value = result[i].BuildTopologies[j].TacticValue;
            Data.push(itemB);

            var linkItemB = new Object();
            linkItemB.source = dataid;
            linkItemB.target = dataid + 1 + j;
            links.push(linkItemB);

        }

        dataid = dataid + result[i].BuildTopologies.length + 1;

    }

    Data[0].value = TotalValue;

    var option = {
        title: {
            text: "",
            subtext: "",
            top: "top",
            left: "center"
        },
        tooltip: {},
        legend: [{
            show: false,
            tooltip: {
                show: true
            },
            selectedMode: 'true',
            bottom: 20,
            data: legend
        }],
        toolbox: {
            show: false,
            feature: {
                dataView: {
                    show: true,
                    readOnly: true
                },
                restore: {
                    show: true
                },
                saveAsImage: {
                    show: true
                }
            }
        },
        //animationDuration: 1000, //初始动画的时长，支持回调函数，可以通过每个数据返回不同的 delay 时间实现更戏剧的初始动画效果
        animationEasingUpdate: 'quinticOut',//数据更新动画的缓动效果 
        series: [{
            name: '虚拟电厂资源拓扑',
            type: 'graph',
            layout: 'force',//图的布局。 'none' 不采用任何布局，使用节点中提供的 x， y 作为节点的位置。
            //'circular' 采用环形布局，  'force' 采用力引导布局，
            //circular: {
            //    rotateLabel: true //是否旋转标签，默认不旋转false
            //},
            force: {
                repulsion: 300,//节点之间的斥力因子。
                //支持设置成数组表达斥力的范围，此时不同大小的值会线性映射到不同的斥力。值越大则斥力越大
                edgeLength: 120 //边的两个节点之间的距离，这个距离也会受 repulsion。
                //支持设置成数组表达边长的范围，此时不同大小的值会线性映射到不同的长度。值越小则长度越长。
            },
            data: Data,
            links: links,
            categories: [
                { //节点分类的类目
                    'name': '虚拟电厂',
                    //'symbol': 'triangle',
                    //'symbolSize':100
                },
            {
                'name': '街道',
                //'symbol': 'pin',
                //'symbolSize': 60
            },
            {
                'name': '建筑',
                //'symbol': 'diamond',
                //'symbolSize': 40
            }
            ],
            focusNodeAdjacency: false,//是否在鼠标移到节点上的时候突出显示节点以及节点的边和邻接节点。
            roam: true,//是否开启鼠标缩放和平移漫游。默认不开启。如果只想要开启缩放或者平移，可以设置成 'scale' 或者 'move'。设置成 true 为都开启
            draggable: true,//节点是否可拖拽
            label: {
                normal: {
                    show: true,
                    position: 'top',
                }
            },
            lineStyle: {
                normal: {
                    color: 'source',
                    curveness: 0,//边的曲度，支持从 0 到 1 的值，值越大曲度越大
                    type: "solid"
                }
            }
        }]
    };
    Chart.setOption(option);
    _option = option;
    Chart.on('click', function (params) {
        $("#PlanTitle").html(params.name + " " + params.dataIndex);
        if (_source == null && _target == null) {
            _source = params.dataIndex;
        }
        else if (_source != null && _target == null) {
            _target = params.dataIndex;
            var _linkItem = new Object();
            _linkItem.source = _source;
            _linkItem.target = _target;

            for (var i = 0; i < _option.series[0].links.length; i++) {
                if (_option.series[0].links[i].source === _linkItem.source && _option.series[0].links[i].target == _linkItem.target) {
                    _option.series[0].links.splice(i, 1);
                    break;
                }
                if (i == _option.series[0].links.length - 1) {
                    _option.series[0].links.push(_linkItem);
                    break;
                }
            }

            Chart.setOption(_option);
            _source = null;
            _target = null;
        }

    });
}

